import React, { Component } from 'react';

class ParagraphBlock extends Component {
    render() {
        return (
            <div className="parapgrah">
                <h1>About me</h1>
                <p>
                About me <span> icon </span>
                </p>
                <div>className="brands"
                I am  Jerry Prophete, the web developer that you are looking for. 
              I have work on many different projects, which have given me the experience that can solve your website problems.  
                </div>
            </div>
        );
    }
}

export default ParagraphBlock;
